  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115171 includes chemical,
  discrete sample, physical and profile data collected from THOMAS WASHINGTON in the
  South Pacific Ocean from 1991-07-16 to 1991-08-25 and retrieved during cruise TUNES_2
  and WOCE_P16S17S. These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-12 (CFC-12), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3,
  DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE,
  NITRITE, PHOSPHATE, Partial pressure (or fugacity) of carbon dioxide, Potential
  temperature (theta), SALINITY, SILICATE, Tritium (Hydrogen isotope) and WATER TEMPERATURE.
  The instruments used to collect these data include CTD and bottle. These data were
  collected by Taro Takahashi of Columbia University; Lamont-Doherty Earth Observatory
  as part of the WOCE_P16S17S data set.nnThe World Ocean Circulation Experiment (WOCE)
  was a major component of the World Climate Research Program with the overall goal
  of better understanding the ocean's role in climate and climatic changes resulting
  from both natural and anthropogenic causes. The CO2 survey took advantage of the
  sampling opportunities provided by the WOCE Hydrographic Program (WHP) cruises during
  this period between 1990 and 1998. The final collection covers approximately 23,000
  stations from 94 WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
